import React from 'react';
import styles from './Navbar.module.css';

const Navbar = (props) => {
  return (
    <nav className={styles.nav}>
      <div>
        <div>
          <div>Shortcuts</div>
        </div>
        <div>
          News Feed Inbox My Pages Friends Images Videos Messages Notifications People Nearby
          Insights Logout
        </div>
      </div>
    </nav>
  );
};
export default Navbar;
